cking your view. Fits Your Phone Perfectly: Designed for 4-6 inches phones, the durable car mobile holder ensures compatibility with various devices. Plus, its smart design lets you connect charging cables conveniently. One Push Release: Install and release your phone in seconds with just one hand using the single-touch button. Keep your focus on the road as your phone remains stable and safe within reach. Built to Last: Made from scratch and shock-free ABS material, the Portronics Clamp M3 Car Windshield and Dashboard Mobile Holder promises durability and longevity. Your Navigation Companion: Ideal for drivers, this car phone holder is your perfect partner for using navigation maps. Stay on course while Clamp M3 keeps your phone steady and accessible.'),(266,'https://www.amazon.in/Portronics-Adjustable-Windshield-Rotational-Compatible/dp/B0CFL4SPTY/ref=sr_1_9?dib=eyJ2IjoiMSJ9.f1CDQrdL6WIsNU9QVa9kRWYy_8ida58ZwjDpYvnF4Nzz_egKGxcPZlongZ3KBLrOLv-l7kDsUAnPKaiP8Nt0C5FPxK8Y3OLcBh4aYkWyAiyC9IbeEKR0PbmAiqLrE1GgxKlnI60_aGASULnpfyyufrBy-VLRiUQ5W96IeWoL0klmU_x-f1KQHdttXTtg_O2-1c7Bxeu3xL1DmaecnEdSPY1XWItKSale0yc3MwiS7AIJEEORoQT-dX9wiu7n5wvF7Iq17lZgsqnxTEKzEJamaZajoHB4uqZu4RvkGSF425Q.hnnyAPUjx4ZAhD1LL-0-xcqy-qVhh4IjdyY0nftbTjk&dib_tag=se&qid=1716053411&refinements=p_72%3A1318476031&rnid=1318475031&s=electronics&sr=1-9','Amazon','highly_rated_by_customer_for','durable product, value for money, looks good'),(267,'https://www.amazon.in/Portronics-Adjustable-Windshield-Rotational-Compatible/dp/B0CFL4SPTY/ref=sr_1_9?dib=eyJ2IjoiMSJ9.f1CDQrdL6WIsNU9QVa9kRWYy_8ida58ZwjDpYvnF4Nzz_egKGxcPZlongZ3KBLrOLv-l7kDsUAnPKaiP8Nt0C5FPxK8Y3OLcBh4aYkWyAiyC9IbeEKR0PbmAiqLrE1GgxKlnI60_aGASULnpfyyufrBy-VLRiUQ5W96IeWoL0klmU_x-f1KQHdttXTtg_O2-1c7Bxeu3xL1DmaecnEdSPY1XWItKSale0yc3MwiS7AIJEEORoQT-dX9wiu7n5wvF7Iq17lZgsqnxTEKzEJamaZajoHB4uqZu4RvkGSF425Q.hnnyAPUjx4ZAhD1LL-0-xcqy-qVhh4IjdyY0nftbTjk&dib_tag=se&qid=1716053411&refinements=p_72%3A1318476031&rnid=1318475031&s=electronics&sr=1-9','Amazon','product_imp