ng wireless printing from various devices. 【Quality prints】Achieve high-quality prints with HP 47 Original Black Cartridge and HP 47 Setup Tri-color Cartridges, yielding up to 1300 black and 700 color pages. 【Warranty and support】With a one-year limited warranty, you can print with confidence, knowing you have our 12x7 voice support or 24x7 chat support for quick assistance. 【Fast printing】Print without delays with printing speeds up to 7.5 ppm (black) and 5.5 ppm (color). Ideal for quick and quality prints for everyday use. 【Input and output】With a 60-sheet input tray, 25-sheet output tray, and support for A4, B5, A6, and DL envelope standard media sizes, this printer can handle your daily printing needs efficiently. 【Easy-to-use interface】Navigate effortlessly through your all your tasks with the user-friendly Icon LCD display, 7 buttons, and 5 LED indicator lights (Power, Ink level, Wi-Fi, Resume & Info). 【Compatible OS】This printer supports multiple operating systems, including Windows 11/10, macOS 10.14/10.15/11/12/13, and Chrome OS, ensuring flexibility and ease of use. 【1,000-page duty Cycle】Designed for durability and efficiency, this printer offers a duty cycle of up to 1000 pages per month, perfect for your high-volume printing needs.'),(2150,'https://www.amazon.in/HP-Advantage-Starting-44paise-Additional/dp/B0CJJL9PN9/ref=sr_1_2?dib=eyJ2IjoiMSJ9.KKwBqMlaAC420KnT8lyAwLYu0W3-K_NQwuYJkYHZW2SLrVsf3hNqQEuRYV3COn-IjxgRXXWrk-jq8ypAxaThkEOegIEXH4TcbFvEKXdVr1lPgAa7fZvsjuvtDFFV91mFcRzMAdqhZ1tBMZ43qycPZuVw0VgVwzNyvcjDBsey5wEqH8t0mCcwqpo8pWqTpknqXQHwPqHR33ZWZ7uDdW1xqysNPJ9OoBpPF_cPODg4jQ_ViezmvHMD9uSr8px63GF3oW0g5VMk03KbUb0DLSfvHHQsuQTlaRIjpPf5svFqzbs.OTL2oEJvfLnkECfF5VFdNt10_TRqTzGMjsQ0pUzpYXg&dib_tag=se&qid=1716226215&refinements=p_72%3A1318476031&rnid=1318475031&s=computers&sr=1-2','Amazon','highly_rated_by_customer_for','easy to install, good for home use, durable product'),(2151,'https://www.amazon.in/HP-Advantage-Starting-44paise-Additional/dp/B0CJJL9PN9/ref=sr